import React from 'react';
import './ClubPage.css';
import {Page,Header,PageSection,PageSidebar, Grid, GridItem } from '@patternfly/react-core';
import Bar from "../SearchBar/SearchBar.js"
import Tags from "../Tags/Tags.js"
import Card from "../ClubCard/ClubCard.js"

export default class ClubPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isNavOpen: true
    };
    this.onNavToggle = () => {
      this.setState({
        isNavOpen: !this.state.isNavOpen
      });
    };
  }

    render() {
      const { isNavOpen } = this.state;
      const Sidebar = <PageSidebar props={Bar,Tags} theme="dark" />;
        return (
          <Page header={Header} sidebar={Sidebar}>
          <Sidebar><Bar></Bar></Sidebar>
          <PageSection style={{height: '10em'}}>
            <Grid>
              <GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem>
              <GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem><GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem>
              <GridItem span={1}></GridItem>
              <GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem>
              <GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem><GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem>
              <GridItem span={1}></GridItem>
              <GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem>
              <GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem><GridItem span={1}></GridItem>
              <GridItem span={3}>
                 <Card></Card>
              </GridItem>
              <GridItem span={1}></GridItem>
            </Grid>

        </PageSection>
          </Page>

        ); 

    }
}
